style.css:
@-moz-document domain("torrentgalaxy.to") {
#headnew {
    background: radial-gradient(ellipse at center,#272a16 100%,#a70606 5%);
}

body {
    background-color: #2b2b2b;
}
a {
    color: #999999;
}
ul.navbar-nav > li > a:hover, ul.navbar-nav > li > a:active
{
    background-color: #333333;
}
a:hover, a:active {
    color: #999999;
}
.row {
    margin: 1;
}
.tgxtablerow {
    background-color: #333333;
}
.tgxtablerow:nth-of-type(2n+1) {
    background-color: #444444;
}
.tgxtablerow a {
    color: #666666;
}
.tgxtablerow:hover, .tgxtablerow:active, .tgxtablerow:nth-of-type(2n+1):hover, .tgxtablerow:nth-of-type(2n+1):active
{
    background-color: #444444;
}
.tprow, .newtablerow, .tprow:hover {
    background-color: #444444;
}
.tprow:nth-of-type(2n+1), .newtablerow:nth-of-type(2n+1)
{
    background-color: #333333;
}
#intblock {
    border-color: #000000;
}
#intblockheader
{
    border-color: #bcb2b2;
    background-color: #000000;
}
#innerhead {
    background-color: #666666;
    color: #000000;
}
.breadcrumb, .form-control, .btn-default,
.pagination > li > a, .pagination > li > span,
.table-striped > tbody > tr:nth-of-type(2n+1),
.likeboxtr,
.panel,
.chattersonline
{
    background-color: #555555;
    color: #000000;
}
#panelmain {
	border-color: black;
	color: #000000;
	background-color: #444444;
}
#panelmain legend {
    color: #000000;
}
img.profile {
    border-color: #000000;
}

.alert-info {
    background-color: #444444 !important;
}

.ntranimate:hover, .ntranimate:active,
.ntranimate:nth-of-type(2n+1):hover, .ntranimate:nth-of-type(2n+1):active{
    background-color: #333333;
}

#smallnav[href="/account.php"] {
    background-color: transparent !important;
    color: #666666 !important;
}

textarea#ghosted.mail,
textarea.mail,
#ddnews
{
    background-color: #444444;
    color: #999999;
}

.well {
    background-color: #555555;
    color: #bcb2b2;
}
.btn-default:hover, .btn-default:active,
.pagination > li > a:hover, .pagination > li > span:hover,
.pagination > li > a:active, .pagination > li > span:active
{
    background-color: #303030;
    color: #999090;
}
.pagination > .disabled > a, .pagination > .disabled > a:focus, .pagination > .disabled > a:hover, .pagination > .disabled > span, .pagination > .disabled > span:focus, .pagination > .disabled > span:hover {
    background-color: #333333;
}
.pagination > .active > a, .pagination > .active > a:focus, .pagination > .active > a:hover, .pagination > .active > span, .pagination > .active > span:focus, .pagination > .active > span:hover {
    background-color: #032848;
    border-color: #032848;
}
th.forumhead {
    background-color: #c2c2a3;
}
tr.subforumhead {
    background-color: #ffffff !important;
}
.clickable-row:hover, .clickable-row:active {
    background-color: rgba(255,255,255.0) !important;
}
.subforumhead:hover, .subforumhead:active {
    background-color: #333333 !important;
}

#inthpheader {
    background-color: #000000;
}

.select select {
    background-color: #555555;
    color:  #888888;
}
.select select:hover, .select select:active, .select select:focus {
    color: #666666;
    background-color: #000000 !important;
}

.btn-success {
    background-color:  #4c0581;
    border-color: #4c0581;
}
.btn-success:hover, .btn-success:active, .btn-success:focus {
    background-color: #058b8b;
    border-color: #058b8b;
}
#filterbox, #filterbox2 {
    background-color: #666666;
}form[name="upload"] .input-group > input {
    background-color: #666666;
    color: #068585;
}
#ddnews:nth-of-type(2n+1) {
    background-color: #666666;
}
.chatbox {
    background-color: #e9e9e9;
}
#chatcoldd:nth-of-type(2n+1) {
    background-color: #f6f6f6;
}
.chatinputdiv button {
    background-color: #bcb2b2 !important;
}
#bbinput {
    background-color: #222222 !important;
    color: #ffffff !important;
}
.chattersonline > .namebadge {
    border: black;
    box-shadow: none;
    background: none;
}
.namebadge {
    background: none;
    border-color: #000000;
}
.namebadge:hover, .namebadge:active, .namebadge:focus
{
    background: none;
    background-color: #ffffff;
    border-color: #000000;
}
#arcade {
    background-color: #d6d6d6c9;
    box-shadow: 0 0 10px 5px red inset;
}
.thumbnail {
    background-color: #504d4d;
}
.thumbnail .caption {
    color: #8FBC8F;
}
.panel-primary > .panel-heading {
    border-bottom: none;
}
}
